import React from "react";

function Skills() {
  return (
    <section id="skills">
      <h2>Skills</h2>
      <div className="skills-list">
        <span className="badge">HTML</span>
        <span className="badge">CSS</span>
        <span className="badge">JavaScript</span>
        <span className="badge">React</span>
        <span className="badge">Git</span>
        <span className="badge">Problem Solving</span>
        <span className="badge">Teamwork</span>
        <span className="badge">Communication</span>
      </div>
      <p style={{ marginTop: "16px" }}>I am constantly learning and improving my technical and soft skills as I work on projects.</p>
    </section>
  );
}

export default Skills;
